/* eslint-disable import/no-anonymous-default-export */
import React from "react";
import "./App.css";

import Card from "./components/layout/Card";

import Familia from "./components/basicos/Familia";
import FamiliaMembro from "./components/basicos/FamiliaMembro";
import Primeiro from './components/basicos/Primeiro';
import ComParametro from './components/basicos/ComParametro';
import Fragmento from './components/basicos/Fragmento';
import Aleatorio from "./components/basicos/Aleatorio";

export default () => (
    <div className="App">
        <h1>Fundamentos React</h1>

        <div className="Cards">
            <Card titulo="#05 - Componente com Filhos" color="blue">
                <Familia sobrenome="Priquitinha">
                    <FamiliaMembro nome="Jorge" />
                    <FamiliaMembro nome="Florzinha" />
                    <FamiliaMembro nome="Marcelo" sobrenome="Santiago"/>
                </Familia>
            </Card>

            <Card titulo="#04 - Desafio Aleatorio" color="#080">
                <Aleatorio min={1} max={60}/>
            </Card>

            <Card titulo="#03 - Fragmento">
                <Fragmento />
            </Card>

            <Card titulo="#02 - Com Parametro">
                <ComParametro
                    titulo='Situacao do aluno'
                    aluno='Jorge' nota={9.3}/>
            </Card>

            <Card titulo="#01 - Primeiro Componente">
                <Primeiro></Primeiro>
            </Card>
        </div>
    </div>
);
